import {
  FormControl,
  FormLabel,
  FormErrorMessage,
  FormHelperText,
  Box,
} from '@chakra-ui/react'

function App() {
  return (

    <div className="App">

      <Box bg='lightblue' w='40%' p={4} color = 'white'>
      <FormControl>
        <FormLabel>Add Sundae</FormLabel>
        <FormHelperText>Here is some other text</FormHelperText>
      </FormControl>
      </Box>
    </div>

  );
}

export default App;
